import React, {useEffect} from 'react'
import {useDispatch, useSelector} from 'react-redux'
import {loadMovies} from '../actions/movieAction'
const Home = () =>{
    const dispatch = useDispatch();
    useEffect(()=>{
      dispatch(loadMovies());
    }, [dispatch])

    const movie = useSelector((state) => state.movie)
    console.log(movie);
    return(
        <div>
            <h1>HoMe</h1>
        </div>
    )
}

export default Home
